import React from "react";
import { createStackNavigator } from "@react-navigation/stack";

import Home from "../screens/Home";
import Product from "../screens/Products";
import Tools from "../screens/Tools";
import Config from "../screens/Config";


const Stack = createStackNavigator();


const HomeStackNavigator = () => {
  return (
    <Stack.Navigator
    screenOptions={{
        headerStyle: {
          backgroundColor: "#242945",
        },
        headerTintColor: "white",
        headerBackTitle: "Back",
      }}
    >
      <Stack.Screen name="Home" component={Home} />
      <Stack.Screen name="Tools" component={Tools} />
    </Stack.Navigator>
  );
}
const ProductStackNavigator = () => {
    return (
      <Stack.Navigator 
      screenOptions={{
        headerStyle: {
          backgroundColor: "#242945",
        },
        headerTintColor: "white",
        headerBackTitle: "Back",
      }}
      >
        <Stack.Screen name="Product" component={Product} />
      </Stack.Navigator>
    );
  }
const ToolsStackNavigator = () => {
    return (
      <Stack.Navigator 
      screenOptions={{
        headerStyle: {
          backgroundColor: "#242945",
        },
        headerTintColor: "white",
        headerBackTitle: "Back",
      }}
      >
        <Stack.Screen name="Tools" component={Tools} />
      </Stack.Navigator>
    );
  }
const ConfigStackNavigator = () => {
    return (
      <Stack.Navigator 
      screenOptions={{
        headerStyle: {
          backgroundColor: "#242945",
        },
        headerTintColor: "white",
        headerBackTitle: "Back",
      }}
      >
        <Stack.Screen name="Config" component={Config} />   {/* yahan p os screen ka name or component aaega jahan hm navigate karwana chate hain */}
      </Stack.Navigator>
    );
  }
  
  export { HomeStackNavigator, ProductStackNavigator, ToolsStackNavigator,ConfigStackNavigator };
